import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Obituary ()
{
    const [data, setData] = useState([])

    useEffect( () =>
    {
        axios.get( 'http://localhost:8081/' )
            .then( res => setData(res.data) )
            .catch( err => console.log( err ) );
    }, [] )
    
  return (
      <div>
          <div>
              <table>
                  <tbody>
                      <tr>
                          <th>Thumbnail</th>
                          <th>Title</th>
                          <th>Packages</th>
                          <th>Status</th>
                          <th>Time</th>
                          <th>Action</th>
                      </tr>
                  </tbody>
              </table>
          </div>
      </div>
  )
}

export default Obituary
